import React from 'react';

interface Post {
    title: string;
    location: string;
    participants: string;
    time: string;
    views: number;
    image: string;
}

const posts: Post[] = [
    {
        title: "7월 5일 같이 뚝섬 플로깅해요",
        location: "뚝섬",
        participants: "5명 모집",
        time: "오후 7시",
        views: 450,
        image: "image-url-1"
    },
    {
        title: "낙산공원 플로깅 후기",
        location: "낙산공원",
        participants: "모집 없음",
        time: "오전 10시",
        views: 450,
        image: "image-url-2"
    },
    {
        title: "같이 부산에서 플로깅 하실 분 구합니다!",
        location: "부산 해운대",
        participants: "3명 모집",
        time: "오후 4시",
        views: 450,
        image: "image-url-3"
    },
    {
        title: "청계천 플로깅 하실분~!",
        location: "서울 청계천",
        participants: "1명 모집",
        time: "오후 8시",
        views: 450,
        image: "image-url-4"
    },
];

function PopularPosts() {
    return (
        <section className="popular-posts">
            <h2>인기글</h2>
            {posts.map((post, index) => (
                <div className="post" key={index}>
                    <img src={post.image} alt={post.title} />
                    <div className="post-details">
                        <h3>{post.title}</h3>
                        <p>{post.location} | {post.participants} | {post.time}</p>
                        <span>{post.views} views</span>
                    </div>
                </div>
            ))}
        </section>
    );
};

export default PopularPosts;
